pragma solidity ^0.8.20;

import "hopium/common/interface/ierc20.sol";
import "hopium/multiswap-eth/interface/uniswapV2.sol";
import "hopium/multiswap-eth/interface/uniswapV3.sol";

abstract contract PoolFinder {
    /// @notice Finds the TOKENâ€“WETH pool with the most WETH across Uniswap V2 and V3.
    /// @return isV3 True if best pool is V3, false if V2
    /// @return pool Address of the best pool (pair for V2, pool for V3)
    /// @return fee V3 fee tier (0 for V2)
    /// @return wethLiquidity Raw WETH in pool (wei)
    function findBestWETHPool(address token, address WETH, IUniswapV2Factory v2Factory, IUniswapV3Factory v3Factory)
        public
        view
        returns (bool isV3, address pool, uint24 fee, uint256 wethLiquidity)
    {
        require(token != address(0), "token=0");
        require(token != WETH, "token=WETH");

        // ----- Uniswap V2 -----
        address v2Pair = v2Factory.getPair(token, WETH);
        if (v2Pair != address(0)) {
            (uint112 r0, uint112 r1, ) = IUniswapV2Pair(v2Pair).getReserves();
            address t0 = IUniswapV2Pair(v2Pair).token0();
            uint256 wethReserves = (t0 == WETH) ? uint256(r0) : uint256(r1);
            if (wethReserves > wethLiquidity) {
                isV3 = false;
                pool = v2Pair;
                fee = 0;
                wethLiquidity = wethReserves;
            }
        }

        // ----- Uniswap V3 (check common fee tiers) -----
        uint24[4] memory fees = [uint24(100), uint24(500), uint24(3000), uint24(10000)];
        for (uint256 i = 0; i < fees.length; i++) {
            address v3Pool = v3Factory.getPool(token, WETH, fees[i]);
            if (v3Pool == address(0)) continue;

            // Proxy for depth: WETH balance in the pool
            uint256 wethBal = IERC20(WETH).balanceOf(v3Pool);
            if (wethBal > wethLiquidity) {
                isV3 = true;
                pool = v3Pool;
                fee = fees[i];
                wethLiquidity = wethBal;
            }
        }
    }
}

